import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import Home from './components/Home';
import Events from './components/Events';
import Login from './components/Login';
import Footer from './components/Footer';
import AboutUs from './components/AboutUs';
import HomePage from './pages/HomePage';
import CallToAction from './components/CallToAction'; // Import CallToAction component
import SignUp from './components/SignUp'; // Import SignUp component

function App() {
  return (
    <Router>
      <div>
        <Navbar />
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/about" element={<AboutUs />} />
          <Route path="/events" element={<Events />} />
          <Route path="/sports" element={<Home />} />
          <Route path="/support" element={<Footer />} />
          <Route path="/login" element={<Login />} />
          <Route path="/signup" element={<SignUp />} /> {/* Render SignUp component */}
          <Route path="/signup-calltoaction" element={<CallToAction />} /> {/* Render CallToAction component */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
